using Microsoft.AspNetCore.Identity;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;
using Petbook.Models;
using System.Collections.Generic;

namespace Petbook.Data
{
    public class ApplicationDbContext : IdentityDbContext<ApplicationUser>
    {
        public ApplicationDbContext(DbContextOptions<ApplicationDbContext> options)
            : base(options)
        {
        }

        public DbSet<ApplicationUser> ApplicationUsers { get; set; }
        public DbSet<BlogPost> BlogPosts { get; set; }
        public DbSet<BlogPostLike> BlogPostLikes { get; set; }
        public DbSet<BlogPostTag> BlogPostTags { get; set; }
        public DbSet<Comment> Comments { get; set; }
        public DbSet<CommentLike> CommentLikes { get; set; }
        public DbSet<Pet> Pets { get; set; }
        public DbSet<Post> Posts { get; set; }
        public DbSet<PostLike> PostLikes { get; set; }
        public DbSet<Tag> Tags { get; set; }

        // Mock lists used for tests
        public List<Object> roles { get; set;  } 
        public List<Object> users { get; set; }
        public List<Object> pets { get; set; }
        public List<Object> posts { get; set; }
        public List<Object> postlikes { get; set; }
        public List<Object> comments { get; set; }
        public List<Object> commentLikes { get; set; }
        public List<Object> blogPosts { get; set; }
        public List<Object> blogPostLikes { get; set; }
        public List<Object> tags { get; set; }
        public List<Object> blogPostTags { get; set; }

        protected override void OnModelCreating(ModelBuilder modelBuilder)
        {

            base.OnModelCreating(modelBuilder);

            // compound primary key definitions
            modelBuilder.Entity<BlogPostTag>()
                .HasKey(bpt => new { bpt.BlogPostTagId, bpt.BlogPostId, bpt.TagId });

            modelBuilder.Entity<BlogPostLike>()
               .HasKey(bpl => new { bpl.BlogPostId, bpl.UserId });

            modelBuilder.Entity<CommentLike>()
               .HasKey(bpt => new { bpt.CommentId, bpt.UserId });

            modelBuilder.Entity<PostLike>()
               .HasKey(bpt => new { bpt.PostId, bpt.UserId });

            // define reltionship with BlogPost and Tag (FK) for BlogPostTag
            modelBuilder.Entity<BlogPostTag>()
                .HasOne(bpt => bpt.BlogPost)
                .WithMany(bpt => bpt.BlogPostTags)
                .HasForeignKey(bpt => bpt.BlogPostId);

            modelBuilder.Entity<BlogPostTag>()
                .HasOne(bpt => bpt.Tag)
                .WithMany(bpt => bpt.BlogPostTags)
                .HasForeignKey(bpt => bpt.TagId);

            modelBuilder.Entity<BlogPostLike>()
               .HasOne(bpt => bpt.BlogPost)
               .WithMany(bpt => bpt.BlogPostLikes)
               .HasForeignKey(bpt => bpt.BlogPostId);

            modelBuilder.Entity<BlogPostLike>()
                .HasOne(bpt => bpt.User)
                .WithMany(bpt => bpt.BlogPostLikes)
                .HasForeignKey(bpt => bpt.UserId);

            modelBuilder.Entity<Comment>()
                .HasOne(com => com.Post)
                .WithMany(com => com.Comments)
                .HasForeignKey(com => com.PostId)
                .OnDelete(DeleteBehavior.Cascade);
        }

        private void CreateDbSetMock(List<List<Object>> initialEntities)
        {
            DeleteAllFromDb();
            foreach (var list_cls in initialEntities)
            {
                if (list_cls.Any())
                {
                    foreach (var entity in list_cls)
                    {
                        AddEntityInDb(entity);
                    }
                }
            }
            this.SaveChanges();
        }

        private void DeleteAllFromDb()
        {
            foreach (var entity in this.ApplicationUsers)
            {
                this.ApplicationUsers.Remove(entity);
            }
            foreach (var entity in this.BlogPosts)
            {
                this.BlogPosts.Remove(entity);
            }
            foreach (var entity in this.BlogPostLikes)
            {
                this.BlogPostLikes.Remove(entity);
            }
            foreach (var entity in this.BlogPostTags)
            {
                this.BlogPostTags.Remove(entity);
            }
            foreach (var entity in this.Comments)
            {
                this.Comments.Remove(entity);
            }
            foreach (var entity in this.CommentLikes)
            {
                this.CommentLikes.Remove(entity);
            }
            foreach (var entity in this.Pets)
            {
                this.Pets.Remove(entity);
            }
            foreach (var entity in this.Posts)
            {
                this.Posts.Remove(entity);
            }
            foreach (var entity in this.PostLikes)
            {
                this.PostLikes.Remove(entity);
            }
            foreach (var entity in this.Tags)
            {
                this.Tags.Remove(entity);
            }
        }

        private void AddEntityInDb(Object entity)
        {
            if (entity is ApplicationUser)
            {
                this.ApplicationUsers.Add(entity as ApplicationUser);
            }
            else if (entity is BlogPost)
            {
                this.BlogPosts.Add(entity as BlogPost);
            }
            else if (entity is BlogPostLike)
            {
                this.BlogPostLikes.Add(entity as BlogPostLike);
            }
            else if (entity is BlogPostTag)
            {
                this.BlogPostTags.Add(entity as BlogPostTag);
            }
            else if (entity is Comment)
            {
                this.Comments.Add(entity as Comment);
            }
            else if (entity is CommentLike)
            {
                this.CommentLikes.Add(entity as CommentLike);
            }
            else if (entity is Pet)
            {
                this.Pets.Add(entity as Pet);
            }
            else if (entity is Post)
            {
                this.Posts.Add(entity as Post);
            }
            else if (entity is PostLike)
            {
                this.PostLikes.Add(entity as PostLike);
            }
            else if (entity is Tag)
            {
                this.Tags.Add(entity as Tag);
            }
        }

        public void PopulateDb(int num)
        {
            List<List<Object>> list = GetRandomListOfApplicationUsers(num);
            users = list[0];
            pets = GetRandomListOfPets(users, num * 2);
            list.Add(pets);
            posts = GetRandomListOfPosts(pets, num * 4);
            list.Add(posts);
            postlikes = GetRandomListOfPostLikes(users, posts, num * 5);
            list.Add(postlikes);
            comments = GetRandomListOfComments(users, posts, num * 6);
            list.Add(comments);
            commentLikes = GetRandomListOfCommentLikes(users, comments, num * 6);
            list.Add(commentLikes);
            blogPosts = GetRandomListOfBlogPosts(users, num);
            list.Add(blogPosts);
            blogPostLikes = GetRandomListOfBlogPostLikes(users, blogPosts, num * 6);
            list.Add(blogPostLikes);
            tags = GetRandomListOfTags(num);
            list.Add(tags);
            blogPostTags = GetRandomListOfBlogPostTags(tags, blogPosts, num * 7);
            list.Add(blogPostTags);
            roles = list[1];
            List<List<Object>> initialEntities = new List<List<Object>>();
            initialEntities.AddRange(new List<List<Object>> { roles, users, pets, posts, postlikes, comments, commentLikes, blogPosts, blogPostLikes, tags, blogPostTags });
            CreateDbSetMock(initialEntities);

        }
        private string GenerateHash()
        {
            const string chars = "abcdefghijklmnopqrtuvwxyz0123456789";
            var random = new Random();
            string str1 = new string(Enumerable.Repeat(chars, 8).Select(s => s[random.Next(s.Length)]).ToArray());
            string str2 = new string(Enumerable.Repeat(chars, 4).Select(s => s[random.Next(s.Length)]).ToArray());
            string str3 = new string(Enumerable.Repeat(chars, 4).Select(s => s[random.Next(s.Length)]).ToArray());
            string str4 = new string(Enumerable.Repeat(chars, 4).Select(s => s[random.Next(s.Length)]).ToArray());
            string str5 = new string(Enumerable.Repeat(chars, 12).Select(s => s[random.Next(s.Length)]).ToArray());
            return str1 + "-" + str2 + "-" + str3 + "-" + str4 + "-" + str5;
        }
        private List<List<Object>> GetRandomListOfApplicationUsers(int num)
        {
            var users_with_roles = new List<List<Object>>();
            var users = new List<Object>();
            var roles = new List<Object>();
            var hasher = new PasswordHasher<ApplicationUser>();
            for (int i = 0; i < num; i++)
            {
                var hash = GenerateHash();
                var user = new ApplicationUser
                {
                    Id = hash,
                    UserName = "user" + i + "@test.com",
                    EmailConfirmed = true,
                    NormalizedEmail = "USER" + i + "@TEST.COM",
                    Email = "user" + i + "@test.com",
                    NormalizedUserName = "USER" + i + "@TEST.COM",
                    PasswordHash = hasher.HashPassword(null, "User" + i + "!"),
                    PhoneNumber = "0712345678",
                };
                users.Add(user);
                if (i % 2 == 0)
                { // make the role of the current user admin
                    var role = new IdentityUserRole<string>
                    {
                        RoleId = "2c5e174e-3b0e-446f-86af-483d56fd7210",
                        UserId = hash
                    };
                    roles.Add(role);
                }
                else // make the role of the current user user
                {
                    var role = new IdentityUserRole<string>
                    {
                        RoleId = "2c5e174e-3b0e-446f-86af-483d56fd7212",
                        UserId = hash
                    };
                    roles.Add(role);

                }
            }
            users_with_roles.Add(users);
            users_with_roles.Add(roles);
            return users_with_roles;
        }

        private List<Object> GetRandomListOfPets(List<Object> users, int num)
        {
            var pets = new List<Object>();
            var categ = new[] { "Dog", "Cat", "Hamster" };
            var random = new Random();
            for (int i = 0; i < num; i++)
            {
                var pet = new Pet
                {
                    PetId = i + 1,
                    UserId = (users[random.Next(users.Count)] as ApplicationUser).Id,
                    PetName = "Pet " + i,
                    Category = categ[random.Next(categ.Length)],
                    Description = "Pet created by the automated tests",
                    Location = "Str. A Nr. " + i
                };
                pets.Add(pet);
            }
            return pets;
        }
